import React from "react";
import style from "./style.css";

function Header() {
    return (
        <div className="jumbotron text-center">
            <div className="container text-yello">
                <h1>Book Vault</h1>
                <h3>Powered by Google Books API</h3>
            </div>
        </div>
    );
}

export default Header;
